//SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface IVote {
    ///notion initialize for First Creation.
    ///param  _veToken the  value for  connect veToken 
    function initialize() external;

    ///notion createVote.
    ///param  _codeModel  GovernanceTemplate ID.
    function createVote(
        string memory _voteTopic,
        string memory _describe,
        uint256  _codeModel,
        uint256  _valaue
        ) external returns(uint256);

    ///notion Vote.
    ///param  _voteId   VoteId
    ///param  _result  false or true 
    function toVote(uint256 _voteId,bool _result) external;    

    ///notion rejecting the proposal.
    ///param  _voteId   VoteId
    ///param  _reasons   The reasons for rejecting the proposal
    function reject(uint256 _voteId,string memory _reasons) external;

    ///notion If the vote passes execute the proposal.
    ///param  _voteId   voteID
    function execute(uint256 _voteId)external;

    ///notion authorize someone else to vote for you
    ///param  _to   authorized person
    function delegateTo(uint256 _voteId,address _to)external;

    ///notion Templates should be set up before voting  
    function setGovernanceTemplate(
        string memory _topic, 
        address _targetAddress, 
        string memory  _functionName) external;

    //notion voting result 
    ///param  _voteId   voteID 
    function winningProposal(uint256 _voteId) external view returns(
        uint256 forVote, 
        uint256 againstVote, 
        uint256 forVote2, 
        uint256 againstVote2, 
        uint256 time);

    event CreateVoteEvent(
        uint256 indexed _voteId,
        string indexed _voteTopic,
        string indexed _describe,
        uint256 _codeModel,
        uint256 _valaue
    );

    event InitializeEvent(address indexed  _veToken);
    event ToVoteEvent(uint256 indexed  _voteId, bool _result);
    event RejectEvent(uint256 indexed  _voteId, string _reasons);
    event ExecuteEvent(uint256 indexed _voteId);
    event DelegateToEvent(uint256 indexed  _voteId, address _to);
    event SetGovernanceTemplateEvent(string _topic, address _targetAddress, string _functionName);
    
}

